  return stdn.filter((x) => x.location === city).map((student) => {
    for (grade of grads) {
      if (student.id === grade.studentId) {
        student['grade'] = grade.grade;
      }
    }
    if (student.grade === undefined) {
      student['grade'] = 'N/A';
    }
    return student;
  });
}

